import React, { useState } from "react";
import styles from "./CreateEvent.module.css";

const CreateEvent = () => {
  const MAX_STEPS = 3;
  const [currentStep, setCurrentStep] = useState(1);

  const handleNext = () => {
    if (currentStep < MAX_STEPS) {
      setCurrentStep((prevStep) => prevStep + 1);
    }
  };

  const handlePrevious = () => {
    if (currentStep > 1) {
      setCurrentStep((prevStep) => prevStep - 1);
    }
  };

  const handleFinish = () => {
    window.location.reload();
  };

  const renderStepContent = (step) => {
    switch (step) {
      case 1:
        return (
          <div>
            <h2>Create a New Event</h2>
            <form>
              <label>
                Event Name:
                <input type="text" placeholder="Enter event name" />
              </label>
              <br />
              <label>
                Date:
                <input type="date" />
              </label>
            </form>
          </div>
        );
      case 2:
        return (
          <div>
            <h2>Event Details</h2>
            <p>
              Provide more information about your event, like location and
              description.
            </p>
            <form>
              <label>
                Location:
                <input type="text" placeholder="Enter location" />
              </label>
              <br />
              <label>
                Description:
                <textarea placeholder="Enter description"></textarea>
              </label>
            </form>
          </div>
        );
      case 3:
        return (
          <div>
            <h2>Review and Confirm</h2>
            <p>Check your event details and confirm everything is correct.</p>
            <button onClick={handleFinish}>Finish!</button>
          </div>
        );
      default:
        return <div>Unknown step</div>;
    }
  };

  return (
    <div className={styles.container}>
      <div class="stepper-wrapper">
        <div class="stepper-item completed">
          <div class="step-counter">1</div>
          <div class="step-name">First</div>
        </div>
        <div class="stepper-item completed">
          <div class="step-counter">2</div>
          <div class="step-name">Second</div>
        </div>
        <div class="stepper-item active">
          <div class="step-counter">3</div>
          <div class="step-name">Third</div>
        </div>
        <div class="stepper-item">
          <div class="step-counter">4</div>
          <div class="step-name">Forth</div>
        </div>
      </div>
      <div className={styles.main}>
        <p className={`${styles.content} ${styles.textCenter}`}>
          Step Number {currentStep}
        </p>
        {renderStepContent(currentStep)}
        {currentStep < MAX_STEPS && (
          <button
            className={styles.nextBtn}
            onClick={handleNext}
            disabled={currentStep === MAX_STEPS}
          >
            Next
          </button>
        )}
        {currentStep > 1 && (
          <button
            className={styles.previousBtn}
            onClick={handlePrevious}
            disabled={currentStep === 1}
          >
            Previous
          </button>
        )}
      </div>
    </div>
  );
};

export default CreateEvent;
